import data from "./data";

function App() {
  return (
    <div >
      <header >
        <a href="/">Dyl's Book Store</a>
      </header>
      <main>
        <h1>Featured Books</h1>
        {
          data.books.map(book => (<div>
            <img src={book.image} alt={book.name}/>
            <p>{book.name}</p>
            <p>by {book.author}</p>
          </div>))
        }
      </main>
    </div>
  );
}

export default App;
